import { Outlet } from "react-router-dom";
import SideBar from "./components/sidebar";
import TrendingBar from "./components/trendingBar";

const PageLayout = () => {
    
    return (
        <div className='bg-stone-800'>
            <div className="relative left-[18%] w-[1000px] h-screen flex flex-row text-white"> 
                    <SideBar/>
                <div className='w-[500px] border-r border-stone-400'>
                    <Outlet/>
                </div>
                <TrendingBar/>
            </div>
        </div>
      )
}

export default PageLayout;
